int main (int argc, char** argv)
{
  bool bOutput   = false;
  bool bEnd      = false;
  bool bShowHelp = true;

  for (int i = 1; i < argc && !bEnd; ++i)
  {
    if (strlen(argv[i]) == 2 && argv[i][0] == '-')
    {
      // commandline option
      switch (argv[i][1])
      {
      case 'd':
        g_bDebugMode = true;
        break;

      case 'k':
        g_bKeepBody = true;
        break;

      case 'j':
        g_bJavaDoc = true;
        break;

      case 'o':
        bOutput = true;
        break;

      case 'i':
        g_bInterfaceOnly = true;
        break;

      case 'b':
        g_bConvertBody = true;
        break;
  
      case 's':
        g_bGenerateSa = false;
        break;

      case 'h':
      default:
	    bEnd = true;
      }
    }
    else
    {
      if (i == argc - 1)
      {
        // input filename
        yyin = fopen(argv[i], "r");

        if (yyin == NULL)
        {
          fprintf(stdout, "Error : Filename %s Not Found.\n", argv[i]);
          return 1;
        }

        bShowHelp = false;

        if (bOutput)
        {
          string filename = argv[i];
          filename += ".cpp";

          OUTPUT = fopen(filename.c_str(), "w");
        }
        else
          OUTPUT = stdout;
      }
    }
  }

  if (bShowHelp || !OUTPUT)
  {
    version_info();
    return 0;
  }

  if (g_bDebugMode)
  {
    fprintf(OUTPUT, "// Running In Debug Mode...\n\n");
  }


  yyout = OUTPUT;
  yylex();

  return 0;
}

